                        <img src="https://s2.loli.net/2022/04/02/nQUSrP31wO4v5EH.jpg" class="w3-display-middle w3-large" alt="" />
                        <p>Prof. Jinsong Su (Xiamen University)</p>
                </section>
            </main>


        </div>
        );
    }
}

export default Members;
